import React from 'react';
import Card from './Cards';
import Sdata from './Sdata';

function App(){
    return(
        <>
            
            {Sdata.map( (val) => {
                return (
                    <Card 
                        imgSrc = {val.imgSrc}
                        title = {val.title}
                        Sname = {val.Sname}
                        link = {val.link}
                    />
                );
            }
            )}
        </>
    );
}

export default App;
